// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Dashboard from './Dashboard'; // Assuming Dashboard.js is in the same directory
import AssignmentsPage from './AssignmentsPage'; // Assuming AssignmentsPage.js is in the same directory
// Import other pages as needed (e.g., ExpenditurePage, PurchasesPage, TransfersPage, LogoutPage)

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Dashboard />} />
        <Route path="/assignments" element={<AssignmentsPage />} />
        {/* Add other routes as necessary */}
        <Route path="/expenditure" element={<div>Expenditure Page</div>} /> {/* Placeholder */}
        <Route path="/purchases" element={<div>Purchases Page</div>} /> {/* Placeholder */}
        <Route path="/transfers" element={<div>Transfers Page</div>} /> {/* Placeholder */}
        <Route path="/logout" element={<div>Logout Page</div>} /> {/* Placeholder */}
        {/* You might want a 404 page for unmatched routes */}
        <Route path="*" element={<div>404 Not Found</div>} />
      </Routes>
    </Router>
  );
}

export default App;
